import WorkDay from './WorkDay'

 const DiaryList =({workingDairies,handleDeleteWorkingDay,handleAddWorkingDairy,handleAddWorkingPiece}) => {
        return (
            <div className="row daily-list">
                {workingDairies.map((workingDairy) => (
                    <WorkDay
                        id = {workingDairy.id}
                        header = {workingDairy.header}
                        handleDeleteWorkingDay = {handleDeleteWorkingDay}  
                        handleAddWorkingDairy = {handleAddWorkingDairy}                   
                    />
                ))}

            </div>
            )

    }

export default DiaryList;
